s powstania listopadowego (w rejonie ul. Andersa), Pozostałości fundamentów Pasażu Simonsa z kamieniem upamiętniającym walczący w ruinach tego budynku batalion "Chrobry I" (w rejonie ul. Bohaterów Getta), Okazały klomb na osi pałacu, Nowoczesny plac zabaw.', '9,20', '4,7');
